import React , {useState} from 'react'
import './الملاعب.css' ;

function StarPark(){


    const [star , setStar ]= useState(false) ;


    return( 
        <>
              <button onClick= {()=> setStar(!star)     }   className="court-name" >
                Star Park
              </button>
     
     
          
      {
              star?  
              <div className="star-table">

              </div>
              

           :null
          }
          
      </>

      
      
    )

    


    

    
    
}export default StarPark ;
